    Q.mat[w4Q.M5O] = U.mat[w4Q.c5O];
    Q.mat[w4Q.b5O] = U.mat[w4Q.x5O];
    Q.mat[w4Q.T43] = U.mat[w4Q.M5O];
    Q.mat[w4Q.S7k] = w4Q.F5O;
    Q.mat[w4Q.k7k] = R.x;
    Q.mat[w4Q.p7k] = R.y;
    Q.mat[w4Q.z7k] = R.z;
