cc.kmMat4PerspectiveProjection = function(Q, U, R, T, W) {
    var P = cc.kmDegreesToRadians(w4Q.f4X(U, w4Q.J5O));
    U = w4Q.z4X(W, T);
    var V = Math.sin(P);
    if (w4Q.X4X(w4Q.F5O, U) || w4Q.a4X(w4Q.F5O, V) || w4Q.r6X(w4Q.F5O, R)) return w4Q.u0S;
    P = w4Q.Y6X(Math.cos(P), V);
    cc.kmMat4Identity(Q);
    Q.mat[w4Q.F5O] = w4Q.U6X(P, R);
    Q.mat[w4Q.d5O] = P;
    Q.mat[w4Q.T43] = -(W + T) / U;
    Q.mat[w4Q.S7k] = -w4Q.E5O;
    Q.mat[w4Q.z7k] = -w4Q.J5O * T * W / U;
    Q.mat[w4Q.j7k] = w4Q.F5O;
    return Q;
};
cc.kmMat4OrthographicProjection = function(Q, U, R, T, W, P, V) {
    cc.kmMat4Identity(Q);
    Q.mat[w4Q.F5O] = w4Q.R6X(w4Q.J5O, (R - U));
    Q.mat[w4Q.d5O] = w4Q.T6X(w4Q.J5O, (W - T));
    Q.mat[w4Q.T43] = -w4Q.J5O / (w4Q.P6X(V, P));
    Q.mat[w4Q.k7k] = -(w4Q.I6X((R + U), (R - U)));
    Q.mat[w4Q.p7k] = -(w4Q.q6X((W + T), (W - T)));
    Q.mat[w4Q.z7k] = -(w4Q.J6X((V + P), (V - P)));
    return Q;
};
cc.kmMat4LookAt = function(Q, U, R, T) {
    var W = new cc.kmVec3,
        P = new cc.kmVec3,
        V = new cc.kmVec3,
        O = new cc.kmVec3,
        E = new cc.kmMat4;
    cc.kmVec3Subtract(W, R, U);
    cc.kmVec3Normalize(W, W);
    cc.kmVec3Assign(P, T);
    cc.kmVec3Normalize(P, P);
    cc.kmVec3Cross(V, W, P);
    cc.kmVec3Normalize(V, V);
    cc.kmVec3Cross(O, V, W);
    cc.kmVec3Normalize(V, V);
    cc.kmMat4Identity(Q);
    Q.mat[w4Q.F5O] = V.x;
    Q.mat[w4Q.g5O] = V.y;
    Q.mat[w4Q.M5O] = V.z;
    Q.mat[w4Q.E5O] = O.x;
    Q.mat[w4Q.d5O] = O.y;
    Q.mat[w4Q.b5O] = O.z;
    Q.mat[w4Q.J5O] = -W.x;
    Q.mat[w4Q.c5O] = -W.y;
    Q.mat[w4Q.T43] = -W.z;
    cc.kmMat4Translation(E, -U.x, -U.y, -U.z);
    cc.kmMat4Multiply(Q, Q, E);
    return Q;
};
cc.kmMat4RotationAxisAngle = function(Q, U, R) {
    var T = Math.cos(R);
    R = Math.sin(R);
    var W = new cc.kmVec3;
    cc.kmVec3Normalize(W, U);
    Q.mat[w4Q.F5O] = T + w4Q.F6X(W.x, W.x, (w4Q.E5O - T));
    Q.mat[w4Q.E5O] = w4Q.g6X(W.z, R) + w4Q.H6X(W.y, W.x, (w4Q.E5O - T));
    Q.mat[w4Q.J5O] = -W.y * R + w4Q.j6X(W.z, W.x, (w4Q.E5O - T));
    Q.mat[w4Q.s5O] = w4Q.F5O;
    Q.mat[w4Q.g5O] = -W.z * R + w4Q.A6X(W.x, W.y, (w4Q.E5O - T));
    Q.mat[w4Q.d5O] = T + w4Q.X6X(W.y, W.y, (w4Q.E5O - T));
    Q.mat[w4Q.c5O] = w4Q.Q8X(W.x, R) + w4Q.m8X(W.z, W.y, (w4Q.E5O - T));
    Q.mat[w4Q.x5O] = w4Q.F5O;
    Q.mat[w4Q.M5O] = w4Q.i8X(W.y, R) + w4Q.h8X(W.x, W.z, (w4Q.E5O - T));
    Q.mat[w4Q.b5O] = -W.x * R + w4Q.T8X(W.y, W.z, (w4Q.E5O - T));
    Q.mat[w4Q.T43] = T + w4Q.V8X(W.z, W.z, (w4Q.E5O - T));
    Q.mat[w4Q.S7k] = w4Q.F5O;
    Q.mat[w4Q.k7k] = w4Q.F5O;
    Q.mat[w4Q.p7k] = w4Q.F5O;
    Q.mat[w4Q.z7k] = w4Q.F5O;
    Q.mat[w4Q.j7k] = w4Q.E5O;
    return Q;
};
cc.kmMat4ExtractRotation = function(Q, U) {
    Q.mat[w4Q.F5O] = U.mat[w4Q.F5O];
    Q.mat[w4Q.E5O] = U.mat[w4Q.E5O];
    Q.mat[w4Q.J5O] = U.mat[w4Q.J5O];
    Q.mat[w4Q.s5O] = U.mat[w4Q.g5O];
    Q.mat[w4Q.g5O] = U.mat[w4Q.d5O];
    Q.mat[w4Q.d5O] = U.mat[w4Q.c5O];
    Q.mat[w4Q.c5O] = U.mat[w4Q.M5O];
    Q.mat[w4Q.x5O] = U.mat[w4Q.b5O];
    Q.mat[w4Q.M5O] = U.mat[w4Q.T43];
    return Q;
};
cc.kmMat4ExtractPlane = function(Q, U, R) {
    var T = "cc.kmMat4ExtractPlane(): Invalid plane index";
    switch (R) {
        case cc.KM_PLANE_RIGHT:
            Q.a = w4Q.t8X(U.mat[w4Q.s5O], U.mat[w4Q.F5O]);
            Q.b = w4Q.s8X(U.mat[w4Q.x5O], U.mat[w4Q.g5O]);
            Q.c = w4Q.Z8X(U.mat[w4Q.S7k], U.mat[w4Q.M5O]);
            Q.d = w4Q.c8X(U.mat[w4Q.j7k], U.mat[w4Q.k7k]);
            break;
        case cc.KM_PLANE_LEFT:
            Q.a = U.mat[w4Q.s5O] + U.mat[w4Q.F5O];
            Q.b = U.mat[w4Q.x5O] + U.mat[w4Q.g5O];
            Q.c = U.mat[w4Q.S7k] + U.mat[w4Q.M5O];
            Q.d = U.mat[w4Q.j7k] + U.mat[w4Q.k7k];
            break;
        case cc.KM_PLANE_BOTTOM:
            Q.a = U.mat[w4Q.s5O] + U.mat[w4Q.E5O];
            Q.b = U.mat[w4Q.x5O] + U.mat[w4Q.d5O];
            Q.c = U.mat[w4Q.S7k] + U.mat[w4Q.b5O];
            Q.d = U.mat[w4Q.j7k] + U.mat[w4Q.p7k];
            break;
        case cc.KM_PLANE_TOP:
            Q.a = w4Q.b8X(U.mat[w4Q.s5O], U.mat[w4Q.E5O]);
            Q.b = w4Q.l8X(U.mat[w4Q.x5O], U.mat[w4Q.d5O]);
            Q.c = w4Q.j8X(U.mat[w4Q.S7k], U.mat[w4Q.b5O]);
            Q.d = w4Q.p8X(U.mat[w4Q.j7k], U.mat[w4Q.p7k]);
            break;
        case cc.KM_PLANE_FAR:
            Q.a = w4Q.S8X(U.mat[w4Q.s5O], U.mat[w4Q.J5O]);
            Q.b = w4Q.v8X(U.mat[w4Q.x5O], U.mat[w4Q.c5O]);
            Q.c = w4Q.Q5X(U.mat[w4Q.S7k], U.mat[w4Q.T43]);
            Q.d = w4Q.m5X(U.mat[w4Q.j7k], U.mat[w4Q.z7k]);
            break;
        case cc.KM_PLANE_NEAR:
            Q.a = U.mat[w4Q.s5O] + U.mat[w4Q.J5O];
            Q.b = U.mat[w4Q.x5O] + U.mat[w4Q.c5O];
            Q.c = U.mat[w4Q.S7k] + U.mat[w4Q.T43];
            Q.d = U.mat[w4Q.j7k] + U.mat[w4Q.z7k];
            break;
        default:
            cc.log(T);
    }
    U = Math.sqrt(w4Q.G5X(Q.a, Q.a) + w4Q.y5X(Q.b, Q.b) + w4Q.n5X(Q.c, Q.c));
    Q.a /= U;
    Q.b /= U;
    Q.c /= U;
    Q.d /= U;
    return Q;
};
cc.kmMat4RotationToAxisAngle = function(Q, U, R) {
    var T = new cc.kmQuaternion,
        W = new cc.kmMat3;
    cc.kmMat4ExtractRotation(W, R);
    cc.kmQuaternionRotationMatrix(T, W);
    cc.kmQuaternionToAxisAngle(T, Q, U);
    return Q;
};
